const handleSearch = async () => {
  try {
    const response = await fetch(`http://localhost:8080/member/getBookByTitle/${bookName}`, {
      method: 'GET',
    });
    if (!response.ok) {
      throw new Error('Book not found');
    }
    const data = await response.json();
    setBook(data);
    setError('');
  } catch (err) {
    setBook(null);
    setError(err.message);
  }
};
